import React from "react";
import Heart from "../assets/images/heart.svg";
// import { DcoLogo } from "../assets/images/dco-logo.svg";

function Footer() {
  return (
    <div className="footer">
      <div className="footer-left">
        Made with <img className="heart-logo" src={Heart} alt="heart-logo" />
        <img className="heart-logo" src={Heart} alt="heart-logo" />
      </div>
      <div className="footer-right">hello@ucsddesign.co</div>
    </div>
  );
}

export default Footer;
